kos/QuickStart.html.body:
KOS快速上手

前期准备：

1、kos依赖redux,react-redux和react-redux-dom；
2、decorator受限编译环境，推荐使用webpack
3、decorator的替代模式是直接调用KOS.Wrapper这个API


建议使用官方的demo，来进行试验，避免环境的准备

代码示例
1、安装kos
npm install kos-core
2、编写Model文件
model.js
const Model={
  namespace:'kos-test',
  // state的初始化数据
  initial:{
    counter:0,
    title:'KOS-Test'
  },
  // 用于处理数据变更的同步的action
  reducers:{
    setTitle(state,action){
      const {title} = action.payload;

      return {
        ...state,
        title
      };
    }
  },
  // 用于处理异步的action
  asyncs:{
    async loadInitData(dispatch,getState,action){
      ///...
      const state = getState();
      setTimeout(()=>{
        dispatch({
          type:'setState',
          payload:{
            count:state.count++
          }
        });
      },1000)
    }
  },
  // 页面初始化会调用
  async setup(dispatch,getState,action){

  }
}

export default Model;

3、编写View文件
view.js
import React from 'react';
import KOS from 'kos-core';

import model from './model';

@KOS.Wrapper({model})
const View = class extends React.Component{
  setTitle(){
    const {dispatch}=this.props;

    dispatch({
      type:'setTitle',
      payload:{
        title:'新的title'
      }
    })；
  }
  loadCount(){
    const {dispatch}=this.props;

    dispatch({
      type:'loadCount',
      payload:{}
    })
  }
  render(){
    const {title,count}=this.props;

    return (
      Title：{title}
      Count：{count}

        {this.setTitle()}}>setTitle
        {this.setCount()}}>setCount

    )

  }
}

export default View

至此，一个基于kos封装的Component已经提供完毕，可以直接使用；

注意：如果您的编译环境没有decorator的能力，可以直接使用，也可以使用如下方式来完成

import React from 'react';
import KOS from 'kos-core';
import model from './model';
const View=class extends React.COmponent{
  render(){
    return (...);
  }
}

export default KOS.Wrapper({model})(View);

4、编写出口文件
index.js
import React from 'react';
import KOS from 'kos-core';
import View from './view';

KOS.start(View,'#main');

代码简洁清爽

kos/extend.html.body:
kos扩展
kos是一款基于redux的数据状态管理的轻框架，本身只提供数据流的状态管理能力，内置异步处理的能力，我们希望基于这样的状态管理和redux中间件能力，提供更多的可扩展，例如kos-form，kos-loading等
kos的扩展参考：

redux中间件开发

kos扩展的使用：
import kos from 'kos-core';
import {formMiddleware} from 'kos-form';

kos.use(formMiddleware);

class Component extends React.component{
  render(){
    return 中间件...
  }
}

kos.start(Component);

kos扩展可使用的API：

kos.getModel(namespace)： 根据namespace来获取Model，从而获取到指定的配置，例：:model.reduces，例如model.asyncs等；
kos.Util.getActionType(type)： 该API将完把namespace和type进行拆分


注意：中间件必须要在kos.start之前注入

kos/Model.html.body:
Model
Model是View的控制器，提供View的数据源、数据操作响应（同步action，异步action） 、初始化数据加载能力、表单校验和表单字段控制能力，基于kos的扩展能力redux中间件扩展所需要的配置，也将在model上承载
一、代码示例
const Model={
  namespace:'kos-test',
  // state的初始化数据
  initial:{
    counter:0,
    title:'KOS-Test'
  },
  // 用于处理数据变更的同步的action
  reducers:{
    setTitle(state,action){
      const {title} = action.payload;

      return {
        ...state,
        title
      };
    }
  },
  // 用于处理异步的action
  asyncs:{
    async loadInitData(dispatch,getState,action){
      ///...
      const state = getState();
      setTimeout(()=>{
        dispatch({
          type:'setState',
          payload:{
            count:state.count++
          }
        });
      },1000)
    }
  },
  // 页面初始化会调用
  async setup(dispatch,getState,action){

  }
}

export default Model;

二、属性说明
1. namespace

类型：string，
说明：namesapce是用来区分不同Model和组件的唯一标识，不能重复，封装后的组件将使用store.getState()对象下的namespace一级的数据

2. initial

类型：Object
说明：提供初始化的默认数据

3. reducers

类型：Object
说明：提供处理同步action的逻辑，key为action.type

我们会注入默认的reducers：
3.1 setState

说明：
setState会将payload提供的数据与state进行merge;

代码示例


this.props.dispatch({
  type:'setState',
  payload:{
    name:'test1'
  }
});

3.1 reset

说明：reset会将model.initial下的数据，覆盖store.getState()[namespace]的数据，默认componentDidMount的时候，会出发该action

代码示例


this.props.dispatch({
  type:'reset',
});

4 setup

说明：加载初始化数据时，执行的action，WrapperComponent会根据Wrapper(config)的autoLoad来确定，是否需要执行

